import React from 'react';
import {Typography} from '@material-ui/core';

const App = () => {
    return ( <div>
        <Typography style={{textAlign: 'center', verticalAlign: 'center'}} variant='h1'>Hello World</Typography>
    </div> );
}

export default App;
